// import popup  from 'reactjs-popup'
import Popup from 'reactjs-popup';
import Modal from 'react-bootstrap/Modal'
// import {Modal} from 'react-native'y

export default class Result extends Component{
    render() {
        return (
            <Popup modal trigger={<button>Click Here to Show the Result</button>}  >
            Modal Content
          </Popup>
        );
      }
}
